--
-- This script needs to be executed only if MCDB is not being used.
--

 DROP TABLE IF EXISTS `shopitems`;
DROP TABLE IF EXISTS `shops`;

CREATE TABLE `shops` (
  `shopid` INT(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `npcid` INT(7) NOT NULL DEFAULT 0,
  PRIMARY KEY (`shopid`)
) ENGINE=InnoDB;

/*!40000 ALTER TABLE `shops` DISABLE KEYS */;
/*!40000 ALTER TABLE `shops` ENABLE KEYS */;

CREATE TABLE `shopitems` (
  `shopitemid` INT(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `shopid` INT(10) UNSIGNED NOT NULL DEFAULT 0,
  `itemid` INT(11) NOT NULL DEFAULT 0,
  `price` INT(11) NOT NULL DEFAULT 0,
  `position` INT(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`shopitemid`),
  KEY `shopid` (`shopid`)
) ENGINE=InnoDB;

/*!40000 ALTER TABLE `shopitems` DISABLE KEYS */;
/*!40000 ALTER TABLE `shopitems` ENABLE KEYS */;